import React from "react";

const headerStyle = {
  color: '#f3be85',
  padding: '20px',
  display: 'flex',
  justifyContent: 'space-between'
}

const menuStyle = {
  ul 
}

const Header = () => {
  return (
    <header className="header" style={headerStyle}>
      <style jsx>{`
        .container {
          margin: 50px;
        }
        p {
          color: blue;
        }
      `}</style>
         <h1>ViajaEnVan</h1>
         <ul>
           <li>Inicio</li>
           <li>Destinos</li>
           <li>Servicios</li>
           <li>Cotactenos</li>
        </ul>
      </header>
  );
};

export default Header;
